import { useEffect } from "react";
import { Link } from "react-router-dom";
import MissionBody from "@components/Mission/MissionBody";
import AOS from "aos";
import "aos/dist/aos";
function Mission() {
  useEffect(() => {
    AOS.init();
  }, []);
  return (
    <main id="main">
      {/* <!-- ======= Breadcrumbs ======= --> */}
      <div className="breadcrumbs d-flex align-items-center" style={{ backgroundImage: 'url("/images/blog-header.jpg")' }}>
        <div className="container position-relative d-flex flex-column align-items-center">
          <h2>미션</h2>
          <ol>
            <li>
              <Link to="/mission">일일미션</Link>
            </li>
            <li>
              <Link to="/mission">주간미션</Link>
            </li>
            <li>
              <Link to="/mission">월간미션</Link>
            </li>
          </ol>
        </div>
      </div>
      {/* <!-- End Breadcrumbs --> */}
      <MissionBody></MissionBody>
      {/* <!-- ======= Blog Section ======= --> */}
      {/* <!-- End Blog Section --> */}
    </main>
  );
}

export default Mission;
